import React from "react";

let chips = [
    {
        date: "October 24",
        weekday: "Friday",
        event: "Priority Registration Deadline. We cannot guarantee spots after this date, so register ASAP!",
        icon: require("../../images/hack25/lastday_final.jpeg"),
    },
    {
        date: "November 5",
        weekday: "Wednesday",
        event: "Final Registration Deadline. No registrations will be accepted after this date.",
        icon: require("../../images/hack25/proposal_final.jpeg"),
    },
    {
        date: "November 13",
        weekday: "Thursday",
        event: "Project Proposal Submission Deadline by 11:59 PM. Late submissions will receive a penalty.",
        icon: require("../../images/hack25/projectdue_final.jpeg"),
    },
    {
        date: "November 15 & 16",
        weekday: "Saturday & Sunday",
        event: "The Hackathon will begin at 9:00am, and will run until 7:00pm both days.",
        icon: require("../../images/hack25/hackathon_final.jpeg"),
    },
];

export default function Timeline() {
    return (
        <section id="timeline" className="pt-6 pb-12 items-center text-white">
            <h1 className="hackheader">Hackathon Timeline</h1>
            <p className="text-center text-2xl mt-6 p-2">
                View the Hackathon Timeline below for more information about important dates and times.
            </p>
            <div className="relative flex flex-col items-center py-12">
                {/* Vertical line */}
                <div className="absolute left-1/2 top-0 w-1 h-full bg-acm-blue/40 -translate-x-1/2 z-0" />
                <div className="flex flex-col gap-12 w-full max-w-3xl z-10">
                    {chips.map((chip, idx) => (
                        <div
                            key={chip.date}
                            className={`relative flex items-center w-full`}
                        >
                            {/* Timeline dot */}
                            <div className="absolute left-1/2 -translate-x-1/2 z-20">
                                <div className="w-6 h-6 rounded-full bg-acm-orange border-4 border-white shadow-lg" />
                            </div>
                            {/* Box */}
                            <div
                                className={`
                                    flex flex-col items-center bg-white/90 text-gray-900 rounded-xl shadow-lg border border-gray-200
                                    p-6 w-[90%] max-w-md
                                    ${idx % 2 === 0 ? "ml-auto mr-8" : "mr-auto ml-8"}
                                `}
                                style={{ minHeight: "320px" }}
                            >
                                <div className="text-center mb-2">
                                    <div className="text-base lg:text-lg font-semibold text-acm-blue">{chip.weekday}</div>
                                    <div className="text-xl lg:text-3xl font-bold">{chip.date}</div>
                                </div>
                                <div className="w-full flex flex-col flex-1 items-center justify-between">
                                    <p className="text-base lg:text-lg text-center mb-2">{chip.event}</p>
                                    <div className="flex-1 flex flex-col justify-end w-full">
                                        <img
                                            src={chip.icon}
                                            alt={chip.event}
                                            className="min-w-[75%] max-w-[90%] max-h-[25vh] mx-auto mt-2 rounded-md shadow"
                                            style={{ marginTop: "auto" }}
                                        />
                                    </div>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
}
